function Card(card) {
    return (
        <section className="cards">
        {cards.map(card => 
            <div className={card.id}>
            <img className="element__image" src={card.link} style={{alt: card.name}} />
            <button type="button" class="element__basket"></button>
            <div className="element__text">
              <h2 className={card.name}></h2>
              <div className="element__likes">
                <button type="button" className="element__heart"></button>
                <p className="element__like-count"></p>
              </div>
            </div>
          </div>

        )}
    </section>

    );

}

export default Card;
